import React from "react";
import { SafeAreaView, Text, View } from "react-native";

const HomeScreen = () => {
  return (
    <View style={{ backgroundColor: "aqua", marginTop: 30 }}>
      <Text>Home</Text>
      <Text>Hola mundo</Text>
    </View>
  );
};

export default HomeScreen;
